import Dashboard from "views/Dashboard.js";
import Modes from "views/Modes";
import ViewCard from "views/viewCard";

var routes = [
  {
    path: "/dashboard",
    name: "Dashboard",
    icon: "nc-icon nc-bank",
    component: <Dashboard />,
    layout: "/user",
  },
  {
    path: "/cards",
    name: "My Card",
    icon: "nc-icon nc-credit-card",
    component: <ViewCard />,
    layout: "/user",
  },
  {
    path: "/modes",
    name: "My Card Modes",
    icon: "fa-solid fa-layer-group",
    component: <Modes />,
    layout: "/user",
  },
 
];
export default routes;
